import{_ as t,c as a,o as s,ag as i}from"./chunks/framework.By5zrZ8k.js";const d=JSON.parse('{"title":"Prerequisites","description":"","frontmatter":{},"headers":[],"relativePath":"projects/mlai/neo/core/prerequisites.md","filePath":"projects/mlai/neo/core/prerequisites.md","lastUpdated":1767893640000}'),o={name:"projects/mlai/neo/core/prerequisites.md"};function r(n,e,l,p,c,u){return s(),a("div",null,[...e[0]||(e[0]=[i(`<h1 id="prerequisites" tabindex="-1">Prerequisites <a class="header-anchor" href="#prerequisites" aria-label="Permalink to &quot;Prerequisites&quot;">​</a></h1><div class="warning custom-block github-alert"><p class="custom-block-title">Important</p><p></p><ul><li>NetApp Neo for M365 Copilot is currently in <strong>Private Preview</strong> . This means that the connector is not yet fully supported and may have some limitations. The connector requires a license to activate. You can request access to the connector by joining the Early Access Program (EAP). Please book a meeting with the following link to join the EAP: <a href="https://outlook.office.com/bookwithme/user/d636d7a02ad8477c9af9a0cbb029af4d@netapp.com/meetingtype/nm-mXkp-TUO1CdzOmFfIBw2?anonymous&amp;ismsaljsauthenabled&amp;ep=mlink" target="_blank" rel="noreferrer">Book a meeting with NetApp</a></li><li>AWS ECS (Fargate) is NOT supported. This is due to the ECS containers being unable to mount shares to the container(s). If using ECS it is recommended to us AWS EC2 Instances.</li></ul></div><h2 id="core-requirements" tabindex="-1">Core Requirements <a class="header-anchor" href="#core-requirements" aria-label="Permalink to &quot;Core Requirements&quot;">​</a></h2><ul><li>Docker / Podman / K8s: Neo is packaged as a container and must be deployed in a container environment</li><li>4 vCPU / 8GB RAM</li><li>Port 8080 (by default) for the web management interface</li><li>Database: <ul><li>PostgreSQL Database (v16+) - can be self-hosted or managed (e.g. AWS RDS, Azure Database for PostgreSQL, etc)</li><li>MySQL Database (v8+) - can be self-hosted or managed (e.g. AWS RDS, Azure Database for MySQL, etc)</li></ul></li><li><code>cifs-utils</code> should be install on your Linux host</li></ul><h2 id="database-options" tabindex="-1">Database Options <a class="header-anchor" href="#database-options" aria-label="Permalink to &quot;Database Options&quot;">​</a></h2><ul><li><strong>PostgreSQL</strong>: For production deployments with high availability (Recommended)</li><li><strong>MySQL</strong>: Alternative production database option</li></ul><p>To use PostgreSQL or MySQL, set the <code>DATABASE_URL</code> environment variable:</p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;"># PostgreSQL example</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">DATABASE_URL</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">postgresql://user:password@localhost:5432/neo</span></span>
<span class="line"></span>
<span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;"># MySQL example</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">DATABASE_URL</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;">mysql://user:password@localhost:3306/neo</span></span></code></pre></div><h2 id="supported-sources" tabindex="-1">Supported Sources <a class="header-anchor" href="#supported-sources" aria-label="Permalink to &quot;Supported Sources&quot;">​</a></h2><p>Neo can connect to the following data sources:</p><ul><li>SMB File Shares (CIFS / SMBv2+). This includes all NetApp ONTAP file shares and non-NetApp SMB shares (i.e. Pure Storage, Isilon, HPE, Windows File Shares, Linux Samba Shares, etc)</li></ul><p>Future support (coming soon):</p><ul><li>NFS File Shares (v3+)</li><li>S3 Buckets (AWS S3, NetApp StorageGRID, etc)</li></ul><h2 id="microsoft-365-copilot-requirements" tabindex="-1">Microsoft 365 Copilot Requirements <a class="header-anchor" href="#microsoft-365-copilot-requirements" aria-label="Permalink to &quot;Microsoft 365 Copilot Requirements&quot;">​</a></h2><p>If you intend to connect your data to Microsoft 365 Copilot, then the following additional requirements apply:</p><h3 id="network-requirements" tabindex="-1">Network Requirements <a class="header-anchor" href="#network-requirements" aria-label="Permalink to &quot;Network Requirements&quot;">​</a></h3><ul><li>Port 443 open for outbound traffic to the MS Graph API</li><li>Port 445 open for SMB file share access</li><li>SMB File Share(s) must be routable to the connector</li></ul><div class="note custom-block github-alert"><p class="custom-block-title">NOTE</p><p>Proxys and SSL Inspection Firewalls are not officially supported although experimental support is available in 3.0.5+</p></div><h3 id="software-requirements" tabindex="-1">Software Requirements <a class="header-anchor" href="#software-requirements" aria-label="Permalink to &quot;Software Requirements&quot;">​</a></h3><ul><li>Microsoft 365 Copilot License</li></ul>`,20)])])}const m=t(o,[["render",r]]);export{d as __pageData,m as default};
